import ExpenseItem from './components/Expense';

function App() {
  const items = [
    {
        date : "June 10 2003" ,
        title : "Car Insurance" ,
        amount : 294.67
    } ,

    {
        date : "Jan 05 2003" , 
        title : "life Insurance" , 
        amount : 300.99
    } ,

    {
        date : "oct 02 2003" , 
        title : "Scooty Insurance" , 
        amount : 999.09
    } ,
    {
        date: "Aug 08 2003" , 
        title : "Maggi Insurance" , 
        amount : 123.45
    }

  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem date = {items[0].date} title={items[0].title} amount = {items[0].amount}></ExpenseItem>
